 realizem a tarefa de coleta de udio e, cujos dados sero sujeitos a processos de anlise de udio e treinamento de redes neurais; numa segunda fase, um sistema de aplicao das informaes resultantes do aprendizados sero utilizadas num ambiente clnico, num processo de validao clnica da ferramenta.\n\nApresentaremos a estrutura e motivaes do projeto, resultados obtidos e os prximos passos de pesquisa.\n\nMinibio:\n\nMarcelo Finger  professor titular de Cincia da Computao na Universidade de So Paulo, Brasil, e pesquisador principal do Centro IBM-Fapesp para Inteligncia Artificial (C4AI) da Universidade de So Paulo. Ele possui graduao (1988) em Engenharia Eletrnica pela Universidade de So Paulo, mestrado (1990) e doutorado (1994) em Computao pelo Imperial College London. Seus interesses de pesquisa abrangem Inteligncia Artificial, Lgica e Raciocnio Destrutivo-Probabilstico, Redes Neurais e Lingustica Computacional.  Marcelo  colunista da Rdio Eldorado desde 2023, com um programa semanal de \"Inteligncia Artificial nas Ondas do Rdio\", que vai ao ar todas as 6as feiras, 8h, e est disponvel em podcast.\n\nSite: https://www.ime.usp.br/~mfinger/\n\nModerador: Adolfo Neto (PPGCA UTFPR Curitiba) https://adolfoneto.elixiremfoco.com/","isCrawlable":true,"thumbnail":{"thumbnails":[{"url":"https://i.ytimg.com/vi/DUXAETM7oek/hqdefault.jpg?v=69034a27\u0026sqp=CKiiqsgG-oaymwEiCKgBEF5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\u0026rs=AOn4CLB_KulilCE_JY92tGTvBY-w3BejpA","width":168,"height":94},{"url":"https://i.ytimg.com/vi/DUXAETM7oek/hqdefault.jpg?v=69034a27\u0026sqp=CKiiqsgG-oaymwEiCMQBEG5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\u0026rs=AOn4CLDcJMAREHXht8r36NYdGe_SyoLiXw","width":196,"height":110},{"url":"https://i.ytimg.com/vi/DUXAETM7oek/hqdefault.jpg?v=69034a27\u0026sqp=CKiiqsgG-oaymwEjCPYBEIoBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\u0026rs=AOn4CLDWdmiS3Ypu-qJIh0oyiuVyAQMJEA","width":246,"height":138},{"url":"https://i.ytimg.com/vi/DUXAETM7oek/hqdefault.jpg?v=69034a27\u0026sqp=CKi ons":[{"action":"ACTION_REMOVE_VIDEO_BY_VIDEO_ID","removedVideoId":"DUXAETM7oek"}]}}}}},"storyboards":{"playerLiveStoryboardSpecRenderer":{"spec":"https://i.ytimg.com/sb/DUXAETM7oek/storyboard_live_90_3x3_b1/M$M.jpg?rs=AOn4CLCBy6dsdzWgQLOMhEjfFkuvZUqqYQ#159#90#3#3"}},"microformat":{"playerMicroformatRenderer":{"thumbnail":{"thumbnails":[{"url":"https://i.ytimg.com/vi/DUXAETM7oek/hqdefault.jpg?v=69034a27","width":480,"height":360}]},"embed":{"iframeUrl":"https://www.youtube.com/embed/DUXAETM7oek","width":640,"height":360},"title":{"simpleText":"SPIRA-BM: Biomarcadores p/Condies Respiratrias em Dispositivos Mveis por Anlise de udio com IA"},"description":{"simpleText":"Ttulo: Projeto SPIRA-BM: Biomarcadores para Condies Respiratrias em Dispositivos Mveis por Anlise de udio com Inteligncia Artificial\n\nAbstract: Descreveremos nesta palestra o projeto SPIRA-BM, que visa desenvolver Biomarcadores para problemas respiratrios usando Inteligncia Artificial em udios coletados de pacientes.  O objetivo geral  o desenvolvimento de conhecimento terico, tcnico e tecnolgico sobre biomarcadores de condies respiratrias, cuja aplicao seja prtica, barata e vivel para a populao brasileira. Utilizando tcnicas de aprendizado de mquina, inteligncia artificial e anlise de udio, vamos investigar biomarcadores  de udio para condies respiratrias como insuficincia respiratria, efeitos do tabagismo, e asma grave.  O projeto visa desenvolver, numa primeira fase,  sistemas de computao mvel que realizem a tarefa de coleta de udio e, cujos dados sero sujeitos a processos de anlise de udio e treinamento de redes neurais; numa segunda fase, um sistema de aplicao das informaes resultantes do aprendizados sero utilizadas num ambiente clnico, num processo de validao clnica da ferramenta.\n\nApresentaremos a estrutura e motivaes do projeto, resultados obtidos e os prximos passos de pesquisa.\n\nMinibio:\n\nMarcelo Finger  professor titular de Cincia da Computao na Universidade de So Paulo, Brasil, e pesquisador principal do Centro IBM-Fapesp para Inteligncia Artificial (C4AI) da Universidade de So Paulo. Ele possui graduao (1988) em Engenharia Eletrnica pela Universidade de So Paulo, mestrado (1990) e doutorado (1994) em Computao pelo Imperial College London. Seus interesses de pesquisa abrangem Inteligncia Artificial, Lgica e Raciocnio Destrutivo-Probabilstico, Redes Neurais e Lingustica Computacional.  Marcelo  colunista da Rdio Eldorado desde 2023, com um programa semanal de \"Inteligncia Artificial nas Ondas do Rdio\", que vai ao ar todas as 6as feiras, 8h, e est disponvel em podcast.\n\nSite: https://www.ime.usp.br/~mfinger/\n\nModerador: Adolfo Neto (PPGCA UTFPR Curitiba) https://adolfoneto.elixiremfoco.com/"},"lengthSeconds":"4957","ownerProfileUrl":"http://www.youtube.com/@forppgcpr","externalChannelId":"UCDbzZ9YQgF77C1RI_pNx0jQ","isFamilySafe":true,"availableCountries":["AD","AE","AF","AG","AI","AL","AM","AO","AQ","AR","AS","AT","AU","AW","AX","AZ","BA","BB","BD","BE","BF","BG","BH","BI","BJ","BL","BM","BN","BO","BQ","BR","BS","BT","BV","BW","BY","BZ","CA","CC","CD","CF","CG","CH","CI","CK","CL","CM","CN","CO","CR","CU","CV","CW","CX","CY","CZ","DE","DJ","DK","DM","DO","DZ","EC","EE","EG","EH","ER","ES","ET","FI","FJ","FK","FM","FO","FR","GA","GB","GD","GE","GF","GG","GH","GI","GL","GM","GN","GP","GQ","GR","GS","GT","GU","GW","GY","HK","HM","HN","HR","HT","HU","ID","IE","IL","IM","IN","IO","IQ","IR","IS","IT","JE","JM","JO","JP","KE","KG","KH","KI","KM","KN","KP","KR","KW","KY","KZ","LA","LB","LC","LI","LK","LR","LS","LT","LU","LV","LY","MA","MC","MD","ME","MF","MG","MH","MK","ML","MM","MN","MO","MP","MQ","MR","MS","MT","MU","MV","MW","MX","MY","MZ","NA","NC","NE","NF","NG","NI","NL","NO","NP","NR","NU","NZ","OM","PA","PE","PF","PG","PH","PK","PL","PM","PN","PR","PS","PT","PW","PY","QA","RE","RO","RS","RU","RW","SA","SB","SC","SD","SE","SG","SH","SI","SJ","SK","SL","SM","SN","SO","SR","SS","ST","SV","SX","SY","SZ","TC","TD","TF","TG","TH","TJ","TK","TL", trackingParams":"CPgBEM2rARgBIhMIl_OJwtjZkAMVX2G4BB2k8RYX","defaultExpanded":false,"descriptionCollapsedLines":3,"showMoreCommand":{"clickTrackingParams":"CPgBEM2rARgBIhMIl_OJwtjZkAMVX2G4BB2k8RYXygEERanlvQ==","commandExecutorCommand":{"commands":[{"clickTrackingParams":"CPgBEM2rARgBIhMIl_OJwtjZkAMVX2G4BB2k8RYXygEERanlvQ==","changeEngagementPanelVisibilityAction":{"targetId":"engagement-panel-structured-description","visibility":"ENGAGEMENT_PANEL_VISIBILITY_EXPANDED"}},{"clickTrackingParams":"CPgBEM2rARgBIhMIl_OJwtjZkAMVX2G4BB2k8RYXygEERanlvQ==","scrollToEngagementPanelCommand":{"targetId":"engagement-panel-structured-description"}}]}},"showLessCommand":{"clickTrackingParams":"CPgBEM2rARgBIhMIl_OJwtjZkAMVX2G4BB2k8RYXygEERanlvQ==","changeEngagementPanelVisibilityAction":{"targetId":"engagement-panel-structured-description","visibility":"ENGAGEMENT_PANEL_VISIBILITY_HIDDEN"}},"attributedDescription":{"content":"Ttulo: Projeto SPIRA-BM: Biomarcadores para Condies Respiratrias em Dispositivos Mveis por Anlise de udio com Inteligncia Artificial\n\nAbstract: Descreveremos nesta palestra o projeto SPIRA-BM, que visa desenvolver Biomarcadores para problemas respiratrios usando Inteligncia Artificial em udios coletados de pacientes.  O objetivo geral  o desenvolvimento de conhecimento terico, tcnico e tecnolgico sobre biomarcadores de condies respiratrias, cuja aplicao seja prtica, barata e vivel para a populao brasileira. Utilizando tcnicas de aprendizado de mquina, inteligncia artificial e anlise de udio, vamos investigar biomarcadores  de udio para condies respiratrias como insuficincia respiratria, efeitos do tabagismo, e asma grave.  O projeto visa desenvolver, numa primeira fase,  sistemas de computao mvel que realizem a tarefa de coleta de udio e, cujos dados sero sujeitos a processos de anlise de udio e treinamento de redes neurais; numa segunda fase, um sistema de aplicao das informaes resultantes do aprendizados sero utilizadas num ambiente clnico, num processo de validao clnica da ferramenta.\n\nApresentaremos a estrutura e motivaes do projeto, resultados obtidos e os prximos passos de pesquisa.\n\nMinibio:\n\nMarcelo Finger  professor titular de Cincia da Computao na Universidade de So Paulo, Brasil, e pesquisador principal do Centro IBM-Fapesp para Inteligncia Artificial (C4AI) da Universidade de So Paulo. Ele possui graduao (1988) em Engenharia Eletrnica pela Universidade de So Paulo, mestrado (1990) e doutorado (1994) em Computao pelo Imperial College London. Seus interesses de pesquisa abrangem Inteligncia Artificial, Lgica e Raciocnio Destrutivo-Probabilstico, Redes Neurais e Lingustica Computacional.  Marcelo  colunista da Rdio Eldorado desde 2023, com um programa semanal de \"Inteligncia Artificial nas Ondas do Rdio\", que vai ao ar todas as 6as feiras, 8h, e est disponvel em podcast.\n\nSite: https://www.ime.usp.br/~mfinger/\n\nModerador: Adolfo Neto (PPGCA UTFPR Curitiba) https://adolfoneto.elixiremfoco.com/","commandRuns":[{"startIndex":1998,"length":32,"onTap":{"innertubeCommand":{"clickTrackingParams":"CPgBEM2rARgBIhMIl_OJwtjZkAMVX2G4BB2k8RYXSOnD7pmTgvCiDcoBBEWp5b0=","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqa1dqOWNZN3NiMjU2YmNvaXhadXY5clFHNzRkd3xBQ3Jtc0ttVmJfRXhTTEpjSENzVzlkRUFycHA2MkdEdjNJU1h1RnBTRkZyODFOaVVZS2VZLXVFbWdxX2pTTzNxeno2YkFSS0tpZGdVVWJNSERoZF8xcVU2ZXVIeENSMGhuMUlHenpCbzZNdUx4QzJOTHA2Sy03MA\u0026q=https%3A%2F%2Fwww.ime.usp.br%2F%7Emfinger%2F\u0026v=DUXAETM7oek","webPageType":"WEB_PAGE_TYPE_UNKNOWN","rootVe":83769}},"urlEndpoint":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqa1dqOWNZN3NiMjU2YmNvaXhadXY5clFHNzRkd3xBQ3Jtc0ttVmJfRXhTTEpjSENzVzlkRUFycHA2MkdEdjNJU1h1RnBTRkZyODFOaVVZS2VZLXVFbWdxX2pTTzNxeno2YkFSS0tpZGdVVWJNSERoZF8xcVU2ZXVIeENSMGhuMUlHenpCbzZNdUx4QzJOTHA2Sy03MA\u0026q=https%3A%2F%2Fwww.ime.usp.br%2F%7Emfinger%2F\u0026v=DUXAETM7oek","target":"TARGET_NEW_WINDOW","no Ve":3611,"apiUrl":"/youtubei/v1/browse"}},"browseEndpoint":{"browseId":"UCDbzZ9YQgF77C1RI_pNx0jQ","canonicalBaseUrl":"/@forppgcpr"}},"channelThumbnail":{"thumbnails":[{"url":"https://yt3.ggpht.com/KpMrcI0yPguHgFjIN11Eb8ZJAhLD9dZonDV8nIgiFHqklHny1KB6wjgHXpup_AbexbEpM0_3sw=s88-c-k-c0x00ffffff-no-rj"}]}}},{"expandableVideoDescriptionBodyRenderer":{"showMoreText":{"accessibility":{"accessibilityData":{"label":"Mostrar mais"}},"simpleText":"...mais"},"showLessText":{"simpleText":"Mostrar menos"},"attributedDescriptionBodyText":{"content":"Ttulo: Projeto SPIRA-BM: Biomarcadores para Condies Respiratrias em Dispositivos Mveis por Anlise de udio com Inteligncia Artificial\n\nAbstract: Descreveremos nesta palestra o projeto SPIRA-BM, que visa desenvolver Biomarcadores para problemas respiratrios usando Inteligncia Artificial em udios coletados de pacientes.  O objetivo geral  o desenvolvimento de conhecimento terico, tcnico e tecnolgico sobre biomarcadores de condies respiratrias, cuja aplicao seja prtica, barata e vivel para a populao brasileira. Utilizando tcnicas de aprendizado de mquina, inteligncia artificial e anlise de udio, vamos investigar biomarcadores  de udio para condies respiratrias como insuficincia respiratria, efeitos do tabagismo, e asma grave.  O projeto visa desenvolver, numa primeira fase,  sistemas de computao mvel que realizem a tarefa de coleta de udio e, cujos dados sero sujeitos a processos de anlise de udio e treinamento de redes neurais; numa segunda fase, um sistema de aplicao das informaes resultantes do aprendizados sero utilizadas num ambiente clnico, num processo de validao clnica da ferramenta.\n\nApresentaremos a estrutura e motivaes do projeto, resultados obtidos e os prximos passos de pesquisa.\n\nMinibio:\n\nMarcelo Finger  professor titular de Cincia da Computao na Universidade de So Paulo, Brasil, e pesquisador principal do Centro IBM-Fapesp para Inteligncia Artificial (C4AI) da Universidade de So Paulo. Ele possui graduao (1988) em Engenharia Eletrnica pela Universidade de So Paulo, mestrado (1990) e doutorado (1994) em Computao pelo Imperial College London. Seus interesses de pesquisa abrangem Inteligncia Artificial, Lgica e Raciocnio Destrutivo-Probabilstico, Redes Neurais e Lingustica Computacional.  Marcelo  colunista da Rdio Eldorado desde 2023, com um programa semanal de \"Inteligncia Artificial nas Ondas do Rdio\", que vai ao ar todas as 6as feiras, 8h, e est disponvel em podcast.\n\nSite: https://www.ime.usp.br/~mfinger/\n\nModerador: Adolfo Neto (PPGCA UTFPR Curitiba) https://adolfoneto.elixiremfoco.com/","commandRuns":[{"startIndex":1998,"length":32,"onTap":{"innertubeCommand":{"clickTrackingParams":"CBAQ040EGAUiEwiX84nC2NmQAxVfYbgEHaTxFhdI6cPumZOC8KINygEERanlvQ==","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbnBpRGFrZ2t4czBHRTdtOW5IOTAteHA4WTlNZ3xBQ3Jtc0tuM09IQjBkZ3lieFFtRlNhSzB3bGhHMTc5VE4yWEV6Tm93N0lqQlJmTGRIcmN2SGExR1V3dk1oQi1KYmJhQ2lOMDd6SGh6STQ4dGVaN2tFekROZlJkZk14NjYtNm1oNThtVlltdVNQS0g1YkFyUWMtRQ\u0026q=https%3A%2F%2Fwww.ime.usp.br%2F%7Emfinger%2F\u0026v=DUXAETM7oek","webPageType":"WEB_PAGE_TYPE_UNKNOWN","rootVe":83769}},"urlEndpoint":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbnBpRGFrZ2t4czBHRTdtOW5IOTAteHA4WTlNZ3xBQ3Jtc0tuM09IQjBkZ3lieFFtRlNhSzB3bGhHMTc5VE4yWEV6Tm93N0lqQlJmTGRIcmN2SGExR1V3dk1oQi1KYmJhQ2lOMDd6SGh6STQ4dGVaN2tFekROZlJkZk14NjYtNm1oNThtVlltdVNQS0g1YkFyUWMtRQ\u0026q=https%3A%2F%2Fwww.ime.usp.br%2F%7Emfinger%2F\u0026v=DUXAETM7oek","target":"TARGET_NEW_WINDOW","nofollow":true}}}},{"startIndex":2078,"length":36,"onTap":{"innertubeCommand":{"clickTrackingParams":"CBAQ040EGAUiEwiX84nC2NmQAxVfYbgEHaTxFhdI6cPumZOC8KINygEERanlvQ==","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbG1XN3BtMUl6TTFsT2F6VGQ3OXdBSjVRNWFad3xBQ3Jtc0trOWpJT1lpY0xxbTNjblRfV1IteGY0NXExd2ZLN
